import { Button, DropdownButton, Dropdown, Spinner } from 'react-bootstrap';
import { CustomFooter, CustomHeader } from "../../components"
import React from "react";

class HomePage extends React.Component {
  render() {
    let searchClient = [
      {
        id: 'some',
        name: 'Profinit',
        DIC: '3434345904900293232',
        ICO: '4590200595920202024',
        // Od: new Date(),
        // First_name: '',
        // Surname: '',
      }
    ]
    let clientsItems = searchClient.map((client) =>
      <div key={client.id}>
        <div className="client-termin">
        <div className="client-time-termin"> {client.name} </div>
        <div className="client-time-termin-new"> {"DIC: " + client.DIC} </div>
        <div className="client-time-termin-new"> {"ICO: " + client.ICO} </div>
        {/* <Button style={{ width: 100, marginLeft: 10, borderRadius: 20 }}
            // onClick={this.handleShowCard.bind(this, client.id)}
            variant="success">
            Card
          </Button> */}

<Button onClick={this.props.edit} fluid style={{ width: 200, borderRadius: 20, fontSize: 20 }} variant="danger">
            Cancel
            </Button>

        </div>
      </div>
    )

    return (
      <div>
        <CustomHeader type="client" fullName="Jiri Spokojeny" />
        <div className="home-body">
        <div className = 'doctor-res'>
            {clientsItems}
            </div>
        </div>
        <CustomFooter />
      </div>
      );
  }
}

export default HomePage;
